import React from 'react'
import {Line} from 'react-chartjs-2';


import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
  } from 'chart.js';
  
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);



var config = {
    type: 'line',
    options: {
      responsive: true,
      plugins: {
        tooltip: {
          mode: 'index',
          intersect: false
        },
        title: {
          display: true,
          text: (ctx) => 'Chart.js Line Chart - stacked=' + ctx.chart.options.scales.y.stacked
        }
      },
      hover: {
        mode: 'index',
        intersec: false,
      },
      scales: {
          yAxes: [{
            scaleLabel: {
              display: true,
              labelString: 'Income in $'
            },
            stacked: true
          }]
        },
          ticks: {
            min: 0,
            max:1500,
            stepSize: 1000
          }
    },
  };




function ThesesChart({chartData}){
  return(
   <Line 
   data={chartData}
   options={config}/>
  );
}

export default ThesesChart
